import React, { useEffect, useRef } from "react";
import { makeStyles } from "@material-ui/core";
import ManageNavbar from "../../src/components/header";
// import "react-responsive-carousel/lib/styles/carousel.min.css";
// import { Carousel } from 'react-responsive-carousel';
import Slider from "react-slick";
import NavigateNextIcon from "@material-ui/icons/NavigateNext";
import NavigateBeforeIcon from "@material-ui/icons/NavigateBefore";
export default function HomePage(props) {
  const classes = useStyles();
  const ref = useRef({});
  const img = [
    { src: "http://lorempixel.com/output/cats-q-c-640-480-6.jpg" },
    { src: "http://lorempixel.com/output/cats-q-c-640-480-6.jpg" },
    { src: "http://lorempixel.com/output/cats-q-c-640-480-6.jpg" },
  ];
  const settings = {
    dots: true,
    speed: 600,
    slidesToShow: 1,
  };
  const next = () => {
    ref.current.slickPrev();
  };
  const prev = () => {
    ref.current.slickNext();
  };
  return (
    <div className={classes.slideHome}>
      <ManageNavbar />
      <Slider {...settings} className={classes.slider} ref={ref}>
        {img.map((image, index) => (
          <div key={index}  className={classes.slidercontent}>
            <img
              className={classes.imgpopup}
              src={image.src}
              // onClick={() => openGallery("item1", index)}
            ></img>
          </div>
        ))}
      </Slider>
      <div class={classes.slidebutton}>
        <div className={classes.next} onClick={() => next()}>
          <NavigateBeforeIcon className={classes.iconbutton} />
        </div>
        <div className={classes.prev} onClick={() => prev()}>
          <NavigateNextIcon className={classes.iconbutton} />
        </div>
      </div>
    </div>
  );
}
const useStyles = makeStyles((theme) => ({
  imgpopup: {
    width: "100%",
    // height:245
    maxHeight: 600,
  },
  slidercontent: {
    width: "100%",
    position: "relative",
    "&:hover div:last-child": {
      opacity: 1,
    },
  },
  slidebutton: {
    transition: "0.2s",
    position: "absolute",
    top: "40%",
    width: "100%",
    display: "flex",
    justifyContent: "space-between",
    opacity: 0,
    height: 0,
  },
  next: {
    width: 30,
    height: 30,
    borderRadius: "50%",
    transition: "0.5s",
    color: "black",
    cursor: "pointer",
    border: "none",
    backgroundColor: "white",
    "&:hover": {
      opacity:1,
      color: "black",
      backgroundColor: "white",
    },
  },
  prev: {
    width: 30,
    height: 30,
    borderRadius: "50%",
    transition: "0.5s",
    color: "black",
    border: "none",
    cursor: "pointer",
    backgroundColor: "white",
    "&:hover": {
      opacity:1,
      color: "black",
      backgroundColor: "white",
    },
  },
  iconbutton: {
    marginTop: 2,
    marginLeft: 2,
  },
  slideHome: {
    flex: "1 1 auto",
  },
}));
